import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import './Home.css'


export class NavigateBar extends Component {
  render() {
    return (
      <div className='background'>
        <nav className='align'>    
        <u >  
            <h3>Train Route Management</h3><br/>
          <li><NavLink to="/routes">To Maintain Routes </NavLink></li><br/><br/>
          <li><NavLink to="/trains">To Maintain Trains </NavLink></li><br/><br/>
          <li><NavLink to="/station">To Maintain Stations </NavLink></li><br/><br/>
          <li><NavLink to="/timesetings">Time Management </NavLink></li><br/><br/>
        </u>
        </nav>
      </div>
    )
  }
}

export default NavigateBar
